import React from "react";
import './App.css';

//Componentes
import Login from "./components/Login";
import Registro from "./components/Registro";
import Inicio from "./components/Inicio";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  NavLink
} from "react-router-dom";


function App() {

  return (
    <Router>
        <div className="fondo">
          <div className="btn-group">
          <NavLink to="/" className="btn btn-dark" activeClassName="active">Inicio</NavLink>
          <NavLink to="/login" className="btn btn-dark" activeClassName="active">Iniciar Sesion</NavLink>
          <NavLink to="/registro" className="btn btn-dark" activeClassName="active">Registro</NavLink>
          </div>
        </div>
      <div className = "App App-header">
        <Switch>
          <Route path="/registro"><Registro/></Route>
          <Route path="/login"><Login/></Route>
          <Route path="/"><Inicio/></Route>
        </Switch>
    </div>
    </Router>
  );
}

export default App;
